import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ProductList from './ProductList'; // Import the ProductList component
import ProductMovements from './ProductMovements'; // Import the ProductMovements component
import AddProduct from './AddProduct'; // Assuming you have this component

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<ProductList />} />
        <Route path="/product/:productId/movements" element={<ProductMovements />} />
        <Route path="/add-product" element={<AddProduct />} />
      </Routes>
    </Router>
  );
};

export default App;
